import React from 'react';
import './Card.css';



const card = ({ items }) => {
    console.log(items);
    return (
        <div>
            {items.map(book => (
                <div className='card-container' key={book.id}>
                    <h2>{book.title}</h2>
                    <img className='card-image' alt='dd' src={book.image} />
                </div>
            ))}
        </div>
    );

}

export default card
